import './App.css';
import Home from './Pages/HomePage';
import { Provider } from 'react-redux';
import store from './Redux/store';

function App() {
  return <div className='app'>

    <Provider store={store}>
      <Home />
    </Provider> 

    </div>
}

export default App;


